import React from 'react'
import {BrowserRouter as Router,Switch,Route} from 'react-router-dom'
import Home from '../pages/Home';
const AppRoutes = () => {
    return (
        <Router>
       <Switch>
           <Rout component={Home}/>
           {/* <Route  component={Error}/> */}
        </Switch>
        </Router>
    )
}
export default AppRoutes;
